description:
A collection of 4 chess books about India's first grandmaster &amp; ex-World champion Vishwanathan Anand who is known in chess world as Vishy:

1. Anand - Topalov: Sofia 2010
2. Heroes of Classical Chess - Learn from Carlsen, Anand, Fischer, Smyslov and Rubinstein
3. Vishy Anand - Great Chess Combinations
4. Vishy Anand - My Best Games of Chess
